import React from 'react';
import "./Home.css";

function Home() {
  return(
    <div className='home'>
        <div className='home__container'>
            <img className='home__image' 
            src="https://m.media-amazon.com/images/I/61bk5XbIQ6L._SX3000_.jpg"            alt="" />
        </div>
    </div>
  );
}

export default Home;
